import {
  FETCH_BOOKINGS_INIT,
  FETCH_BOOKINGS,
  GET_ERRORS
} from "../actions/types";

const initialBookingsState = {
  bookings: [],
  errors: []
};

//reducer for bookings
export const bookings = (state = initialBookingsState, action) => {
  switch (action.type) {
    case FETCH_BOOKINGS_INIT:
      return { ...state };
    case FETCH_BOOKINGS:
      // debugger;
      return { ...state, bookings: action.payload };

    default:
      return state;
  }
};
